import React, { Component } from 'react'
import Typography from '@material-ui/core/Typography'
import Button from '@material-ui/core/Button'

export default class LandingPage extends Component {
	render() {
		return (
			<div style={styles.landingDiv}>
				<Typography style={styles.Typography} align='center' variant="h2" component="h2">
					Hello! I'm <span style={styles.name}>Mekhala Joshi</ span>.<br />
					I'm a full-stack web developer.<br />
					<Button onClick={() => this.props.onClick('two')} variant="outlined" color="secondary" style={styles.Button}>
						View my work
					</Button>
				</Typography>
			</div>
		)
	}
}

const styles = {
	landingDiv: {
		width: '70%',
		height: '710px',
		margin: 'auto',
		// backgroundColor: ' rgba(40, 44, 52, 0)',

	},
	Typography: {
		color: '#fff',
		margin: '0',
		position: 'absolute',
		top: '50%',
		left: '50%',
		fontSize: '3vw',
		transform: 'translate(-50%, -50%)',
	},
	name: {
		color: '#d71559',
		textShadow: '2px 2px #761B36',
		fontWeight: '400',
	},
	Button: {
		color: 'white',
		outline: 'none',
		textTransform: 'none',
		ffontSize: '3vw',
		border: '1px ridge #d71559',
		borderRadius: '0px',
	},
}
